20250607030804	{"\n-- Criar tabela de appointments\nCREATE TABLE public.appointments (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id UUID NOT NULL,\n  client_name TEXT NOT NULL,\n  title TEXT NOT NULL,\n  scheduled_for TIMESTAMP WITH TIME ZONE NOT NULL,\n  status TEXT NOT NULL DEFAULT 'scheduled',\n  notes TEXT,\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Habilitar RLS\nALTER TABLE public.appointments ENABLE ROW LEVEL SECURITY;\n\n-- Polticas RLS para appointments\nCREATE POLICY \\"Users can view their own appointments\\" \n  ON public.appointments \n  FOR SELECT \n  USING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can create their own appointments\\" \n  ON public.appointments \n  FOR INSERT \n  WITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can update their own appointments\\" \n  ON public.appointments \n  FOR UPDATE \n  USING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can delete their own appointments\\" \n  ON public.appointments \n  FOR DELETE \n  USING (auth.uid() = user_id);\n\n-- Criar tabela de reminders se no existir\nCREATE TABLE IF NOT EXISTS public.reminders (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id UUID NOT NULL,\n  title TEXT NOT NULL,\n  description TEXT,\n  due_date TIMESTAMP WITH TIME ZONE NOT NULL,\n  completed BOOLEAN NOT NULL DEFAULT false,\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Habilitar RLS para reminders\nALTER TABLE public.reminders ENABLE ROW LEVEL SECURITY;\n\n-- Polticas RLS para reminders\nCREATE POLICY \\"Users can view their own reminders\\" \n  ON public.reminders \n  FOR SELECT \n  USING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can create their own reminders\\" \n  ON public.reminders \n  FOR INSERT \n  WITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can update their own reminders\\" \n  ON public.reminders \n  FOR UPDATE \n  USING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can delete their own reminders\\" \n  ON public.reminders \n  FOR DELETE \n  USING (auth.uid() = user_id);\n\n-- Criar tabela de tags se no existir\nCREATE TABLE IF NOT EXISTS public.tags (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  name TEXT NOT NULL,\n  color TEXT NOT NULL,\n  user_id UUID NOT NULL,\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Habilitar RLS para tags\nALTER TABLE public.tags ENABLE ROW LEVEL SECURITY;\n\n-- Polticas RLS para tags\nCREATE POLICY \\"Users can view their own tags\\" \n  ON public.tags \n  FOR SELECT \n  USING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can create their own tags\\" \n  ON public.tags \n  FOR INSERT \n  WITH CHECK (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can update their own tags\\" \n  ON public.tags \n  FOR UPDATE \n  USING (auth.uid() = user_id);\n\nCREATE POLICY \\"Users can delete their own tags\\" \n  ON public.tags \n  FOR DELETE \n  USING (auth.uid() = user_id);\n"}	1fad6a86-67d2-4b52-a887-83cb81741369	matheusbalbo10@gmail.com	\N
